    valueSet.add(iit.next());
  }
  assertEquals(length, valueSet.size());
  float[] array = map.toArray();
  assertEquals(length, array.length);
  for (float value: array) {
    assertTrue(valueSet.contains(value));
  }

  float[] array2 = new float[80];
